import React from 'react'
import img1 from '../Images/12884.jpg'
import img2 from '../Images/12885.jpg'
import img3 from '../Images/12886.jpg'
import img4 from '../Images/12887.jpg'
import img5 from '../Images/12888.jpg'
import img6 from '../Images/12889.jpg'
import img7 from '../Images/12890.jpg'

const posts = [
    {
        id:1,
        title:"A Research On Producing Renewable Energy",
        disc:"hjioklpkjhutfrdtfhujiokpl;kjihufgtcdghjklkjhgfghjk",
        img:{img1},
    },
    {
        id:2,
        title:"A Research On Producing Coil",
        disc:"hjioklpkjhutfrdtfhujiokpl;ktgyhujiokjuhygtyjihufgtcdghjklkjhgfghjk",
        img:{img6},
    },
    {
        id:3,
        title:"A Research On Producing Gold ",
        disc:"hjrewrfjuhbygvtfbhunijkpl,ojiuygtfrghjklkjhgfghjk",
        img:{img2},
    },
    {
        id:4,
        title:"A Research On Producing Bombs ",
        disc:"hjioklpkjhutfrdtfhujiokpl;kjihufgtcdghjklkjhgfghjk",
        img:{img3},
    },
    {
        id:5,
        title:"A Research On Producing Cars ",
        disc:"hjioklpkjhutfrdtfhujiokpl;kjihufgtcdghjklkjhgfghjk",
        img:{img4},
    },
    {
        id:6,
        title:"A Research On Producing DNA ",
        disc:"hjioklpkjhutfrdtfhujiokpl;kjihufgtcdghjklkjhgfghjk",
        img:{img5},
    },
]
const Home = () => {
  return (
    <div>
      Home Page
      <div className="posts">
        {posts.map(post =>(
            <div className="post" key={post.id}>
                <img src={post.img} alt="" />
            </div>
        ))}
      </div>
    </div>
  )
}

export default Home
